import React from "react";


const TextInput = ({ label, placeHolder}) => { 
    return (
      <div className="form-group">
        {label && <label>{label}</label>}
        <input type={placeHolder} placeholder={placeHolder} />
      </div>
    );
}
export default TextInput;
